import './App.css';
import React from 'react'
import { Formik, Form } from 'formik';

export const Signup = () => {
    return (
        <Formik>
            {formik => (
            <div>
                <h1 className="my-4-display-4 font-vosweet text-items">Vosweet</h1>
                <p className="main-text text-items">
                Uma mensagem em um click.
                </p>
            </div>    
            )}
        </Formik>
    )
}
